        var graphData, steps, bought, timeSinceBuy, req;
        var bTotal = 0;
        var sTotal = 0;

        function start(url) {
            graphData = [];
            steps = 0;
            bought = false;
            sold = false;
            timeSinceBuy = -1;
            req = false;
            try {
                req = new XMLHttpRequest();
            } catch (e) {
                try {
                    req = new ActiveXObject("Msxml2.XMLHTTP");
                } catch (e) {
                    try {
                        req = new ActiveXObject("Microsoft.XMLHTTP");
                    } catch (e) {
                        graphData = -1;
                    }
                }
            }
            if (!req) graphdata = -1;
            req.onreadystatechange = function () {
                if (req.readyState == 4) {
                    if (req.status === 200) {
                        graphData = JSON.parse(req.responseText).historical;
                        main();
                    } else {
                        window.location.reload(false);
                    }
                }
            }
            req.open("GET", url, true);
            req.send(null);
        }

        start('https://financialmodelingprep.com/api/company/historical-price/' + namelist[~~(Math.random() * namelist.length)] + '?serietype=line&serieformat=array&datatype=json');

        var canvas = document.getElementById("myCanvas");
        var ctx = canvas.getContext("2d");
        ctx.font = "18px Century Gothic";
        ctx.lineWidth = 2;

        function line(x1, y1, x2, y2) {
            ctx.beginPath();
            ctx.moveTo(x1, y1);
            ctx.lineTo(x2, y2);
            ctx.stroke();
        }
        function lpad(st) {
            return (st.length < 2) ? '0' + st : st;
        }
        function average(a) {
            let counter = 0;
            for (let i = 0; i < a.length; i++) {
                counter += a[i];
            }
            return counter / a.length;
        }

        function main() {
            ctx.strokeStyle = "#FF0303";
            var speed = 1;
            var x = (180 / graphData[1][1]);
            function step() {
                ctx.fillStyle = "#DDDDDD";
                ctx.fillRect(0, 0, 190, 125);
                line(0, canvas.height, canvas.width, canvas.height);
                if (speed == 0) {
                    let day1 = new Date(graphData[steps + 1][0]);
                    let day2 = new Date(graphData[steps][0]);
                    speed = (day1 - day2) / 86400000;
                }

                // shift everything to the left:
                var imageData = ctx.getImageData(1, 0, ctx.canvas.width - 1, ctx.canvas.height);
                ctx.putImageData(imageData, 0, 0);
                // now clear the right-most pixels:
                ctx.clearRect(ctx.canvas.width - 1, 0, 1, ctx.canvas.height);

                if (!sold) {
                    timeSinceBuy += 1;
                }
                if (steps < graphData.length - 2) {
                    line(canvas.width - 1, canvas.height - x * graphData[steps][1], canvas.width, canvas.height - x * graphData[steps + ((speed == 1) ? 1 : 0)][1]);
                    speed -= 1;
                    if (speed == 0) {
                        steps += 1;
                    }
                }
                ctx.fillStyle = "#000000";
                if (sold) {
                    ctx.fillText("Sold: $" + sold, 7, 20);
                    ctx.fillText("Gain: $" +Math.round((sold - bought)*100)/100, 7, 81);
                } else {
                    ctx.fillText("Sold:", 7, 21);
                }
                ctx.fillText("Now: $" + graphData[steps][1], 7, 41);
                if (bought) { ctx.fillText("Buy: $" + bought, 7, 61) } else { ctx.fillText("Buy:", 7, 61) }
                if (bTotal) { ctx.fillText("$"+Math.round(bTotal*100)/100 + " -> $" + Math.round(sTotal*100)/100, 7, 106) }


                requestAnimationFrame(step);
            }
            step();
        }

        function keyDownHandler() {
            if (steps >= graphData.length - 2 || (bought && sold)) {
                if (bought) { if (!sold) {sold = graphData[steps][1]} bTotal += bought; sTotal += sold }
                ctx.clearRect(0, 0, canvas.width, canvas.height);

            }
